import React, {
  useCallback,
  useEffect,
  useMemo,
  useReducer,
  useRef,
} from "react";
import Home from "./pages/Home";

const reducer = (state, action) => {
  switch (action.type) {
    case "INIT": {
      return action.data;
    }
    default:
      return state;
  }
};

export const DiaryStateContext = React.createContext();
function App() {
  const [data, dispatch] = useReducer(reducer, []);
  const getpaitent = () => {
